function Navbar(){

    return(<div id="navbar">
    
      <h1>Perfumy</h1>
      <ul>
    
        <li>Home</li>
        <li>Products</li>
        <li>Contact</li>
      </ul>
    
    </div>
    )
    
    }

    export default Navbar
